import React from 'react'


const TesterResultsList = ({results}) => {
  return (
    <div >
      HERE
      if (results == "")
      
      {results.map((result, id) => {
        return <div key={id}>
          {result.title}
          <img src={result.image_url} alt="#" /></div>
        
      })}


    </div>
  )
}

export default TesterResultsList;
